/** @format */

import React from "react";

import { useSelector } from "react-redux";
import { selectIsSignIn } from "../../slices/authenticate.slice";
import { Container, Row, Col, Image } from "react-bootstrap";
import SignIn from "../sign-in/sign-in.component";
import SignUp from "../sign-up/sign-up.component";

const Authenticate = () => {
  const isSignIn = useSelector(selectIsSignIn);
  return (
    <Container style={{ marginTop: "175px" }}>
      <Row>
        <Col xs={6}>
          <Image
            src="https://images.unsplash.com/photo-1466637574441-749b8f19452f?ixlib=rb-1.2.1&ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&auto=format&fit=crop&w=2428&q=80"
            rounded
          />
        </Col>
        <Col xs={6} md={4}>
          {isSignIn ? <SignIn /> : <SignUp />}
        </Col>
      </Row>
    </Container>
  );
};

export default Authenticate;
